import React, {useState} from "react"

function Count() {
    const [count, setCount] = useState(0)

    function increment() {
        setCount(count + 1)
    }
    return(
        <div>
            <h1>count is {count}</h1>
            <button
                onClick={increment}
            >
                Change!
            </button>
        </div>
    )
}

export default Count
